What do we do about things that aren't stored in vectors? We need to pass them to destroy_foo but that's by-value and we can't move them out of a borrowed context (since we're using &mut self within the drop call). The answer is that we cheat. If we just use core::ptr::read we can make a duplicate of any bits we want. The type doesn't even have to be Clone! It's as unsafe as it sounds. How do we offset some of that? With a marker struct called ManuallyDrop , which is magically known to the compiler, and the thing inside of the ManuallyDrop will never run its own destructor automatically. When it's really time to destroy the thing we can call ManuallyDrop::into_inner to unwrap the value and pass it to some destroy function, or we can call ManuallyDrop::drop to force the drop to happen on something that we don't have ownership of. We're actually going to use both styles. For things that go with a destroy_foo method we'll use the ::into_inner style: // The CommandPool must also be unwrapped into a RawCommandPool,
// so there's an extra `into_raw` call here.
self .device .destroy_command_pool(ManuallyDrop::into_inner(read(&mut self.command_pool)).into_raw());
self .device .destroy_render_pass(ManuallyDrop::into_inner(read(&mut self.render_pass)));
self .device .destroy_swapchain(ManuallyDrop::into_inner(read(&mut self.swapchain))); And for our two final items we just use the ManuallyDrop::drop style: ManuallyDrop::drop(&mut self.device);
